def final_position(n, commands):
    # Initial position of the snake
    i, j = 0, 0

    # Process each command
    for command in commands:
        if command == "UP":
            if i > 0:
                i -= 1
        elif command == "DOWN":
            if i < n - 1:
                i += 1
        elif command == "LEFT":
            if j > 0:
                j -= 1
        elif command == "RIGHT":
            if j < n - 1:
                j += 1

    # Convert the 2D position to the linear index
    return (i * n) + j

